import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

class timer extends React.Component {
  render(){
    return (
    <div className="timer">
      <h1><label className="hh">30</label>
      :
      <label className="mm">30</label>
      :
      <label className="ss">30</label>
      </h1>
      <p>&nbsp;&nbsp;&nbsp;Hour &nbsp;&nbsp;&nbsp;&nbsp; Minute &nbsp;&nbsp;&nbsp;&nbsp; Seconde</p>
    </div>
  );}
}

ReactDOM.render(
  <timer time="2433276000" />,
  document.getElementById("root")
);
var time="2433276000"
var seconds     = parseInt(time=time/1000)%60;
var minutes     = parseInt(time=time/60)%60;
var hours       = parseInt(time=time/60)%24;

let hh = document.querySelector(".hh");
let mm = document.querySelector(".mm");
let ss = document.querySelector(".ss");

hh.innerHTML = hours;
mm.innerHTML = minutes;
ss.innerHTML = seconds;

export default timer;
